import React, { Component } from 'react';
import { Button, Card, CardBody, CardFooter, Col, Container, Form, Input, InputGroup, InputGroupAddon, InputGroupText, Row } from 'reactstrap';
import axios from 'axios';

class Register extends Component {
  constructor(props) {
    super(props);
    this.state = {
      email : '',
      first_name : '',
      last_name : '',
      password : '',
      re_password : '',
    };
  }
  handleSubmit = (e) =>{
    e.preventDefault()
    const {email,first_name, last_name, password} = this.state
    axios.post('localhost:4000/register',
      { email : email, first_name : first_name, last_name : last_name, password : password}, {
        headers: {
            'Content-Type': 'application/x-www-form-urlencoded',
        }
      }
        ).then(response => console.log(response)).catch(err => console.log(err))
  }
  handleChange = (e) => {
    e.preventDefault()
    const target = e.target
    const value = target.value
    const name = target.name
    this.setState({
      [name]: value
    });
  }

  render() {
    return (
      <div className="app flex-row align-items-center">
        <Container>
          <Row className="justify-content-center">
            <Col md="9" lg="7" xl="6">
              <Card className="mx-4">
                <CardBody className="p-4">
                  <Form onSubmit={this.handleSubmit}>
                    <h1>Register</h1>
                    <p className="text-muted">Create your account</p>
                    <InputGroup className="mb-3">
                      <InputGroupAddon addonType="prepend">
                        <InputGroupText>
                          <i className="icon-user"></i>
                        </InputGroupText>
                      </InputGroupAddon>
                      <Input type="text" name="first_name" onChange={this.handleChange} value={this.state.first_name} placeholder="First Name" autoComplete="first_name" />
                      <Input type="text" name="last_name" onChange={this.handleChange} value={this.state.last_name} placeholder="Last Name" autoComplete="last_name" />
                    </InputGroup>
                    <InputGroup className="mb-3">
                      <InputGroupAddon addonType="prepend">
                        <InputGroupText>
                          <i className="icon-envelope"></i>
                        </InputGroupText>
                      </InputGroupAddon>
                      <Input type="text" name="email" onChange={this.handleChange} value={this.state.email} placeholder="Email" autoComplete="Email" />
                    </InputGroup>
                    <InputGroup className="mb-3">
                      <InputGroupAddon addonType="prepend">
                        <InputGroupText>
                          <i className="icon-lock"></i>
                        </InputGroupText>
                      </InputGroupAddon>
                      <Input type="password" onChange={this.handleChange} value={this.state.password}  name="password" placeholder="Password" autoComplete="new-password" />
                    </InputGroup>
                    <InputGroup className="mb-4">
                      <InputGroupAddon addonType="prepend">
                        <InputGroupText>
                          <i className="icon-lock"></i>
                        </InputGroupText>
                      </InputGroupAddon>
                      <Input type="password" onChange={this.handleChange} value={this.state.re_password} name="re_password" placeholder="Repeat password" autoComplete="new-password" />
                    </InputGroup>
                    <Button color="success" block>Create Account</Button>
                  </Form>
                </CardBody>
                <CardFooter className="p-4">
                  <Row>
                    <Col xs="12" sm="6">
                      {
                      //<Button className="btn-facebook mb-1" block><span>facebook</span></Button>
                     }
                    </Col>
                    <Col xs="12" sm="6">
                    {
                      //<Button className="btn-twitter mb-1" block><span>twitter</span></Button>
                    }
                    </Col>
                  </Row>
                </CardFooter>
              </Card>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Register;
